export default class UserPerformanceData {
    constructor(id, cardio, energy, strengh, speed, intensity) {
        this.userId = id
        this.cardio = cardio
        this.energy = energy
        this.strengh = strengh
        this.speed = speed
        this.intensity = intensity
    }
}
